import { useEffect } from "react";
import Appbar from "./components/appbar";
import Footer from "./components/footer";
import AppDrawer from "./components/drawer";
import SearchBox from "./components/search";
import Home from "./pages/Home";

function App() {
  useEffect(() => {
    document.title = "React Material UI - Home";
  }, []);
  return (
      <>
          <Router>
      <Container>
        <nav>
          <Button component={Link} to="/" variant="contained" color="primary" style={{ margin: '0 10px' }}>
            Home
          </Button>
          <Button component={Link} to="/about" variant="contained" color="primary" style={{ margin: '0 10px' }}>
            About
          </Button>
        </nav>
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/about" element={<AboutPage />} />
        </Routes>
      </Container>
    </Router>
        <Appbar/>
        <AppDrawer/>
        <SearchBox/>
        <Home/>
        <Footer/>
        </>

  );
}

export default App;
